###DETAILS###'=>'Hej!

Fra WordPress 5.2 er der en indbygget funktion, der registrerer, når et plugin eller et tema er skyld i en fejl på dit websted, og giver dig besked gennem denne automatiserede e-mail.
###CAUSE###
Som det første, skal du besøge dit websted (###SITEURL###) og se efter, om der skulle være synlige problemer. Som det næste, skal du besøge den side, hvor fejlen blevet fundet (###PAGEURL###) og se efter, om der skulle være synlige problemer.

###SUPPORT###

Hvis din side ser ud til at være i stykker, og du ikke har adgang til dit kontrolpanel som normalt, har WordPress nu en særligt "gendannelsestilstand". Denne lader dig logge sikkert ind i kontrolpanelet, så du kan undersøge fejlen nærmere.

###LINK###

For at holde din side sikker vil dette link udløbe om ###EXPIRES###. Bare rolig. Hvis fejlen opstår igen, efter dette tidspunkt, vil der blive sendt en ny e-mail til dig.

Hvis du beder om hjælp til dette problem, vil der måske blive spurgt efter noget af følgende information:
