ige don Quijote drog ud fra sin hjemegn.','Chapter One'=>'Kapitel 1','Which treats of the character and pursuits of the famous Don Quixote of La Mancha.'=>'Der handler om den navnkundige og tapre adelsmand don Quijote de la Mancha, hans stand og virke.','Three columns of text with buttons'=>'Tre kolonner tekst med knapper','Block pattern descriptionA quote and citation with an image above, and a separator at the bottom.'=>'Et citat og en reference med et billede ovenover og en skillelinje i bunden.','— Don Quixote'=>'— Don Quijote','"Do you see over yonder, friend Sancho, thirty or forty hulking giants? I intend to do battle with them and slay them."'=>'"Nu er vi minsandten heldigere end vi kunne ønske, kære Sancho Panza. For dér har vi tredive frygtelige kæmper, sådan godt og vel, som jeg nu vil kæmpe imod og dræbe alle som en."','Pencil drawing of Don Quixote'=>'Blyantstegning af Don Quijote','Quote'=>'Citat','Block pattern descriptionThree filled buttons with rounded corners, side by side.'=>'Tre udfyldte knapper med med runde hjørner, side om side.','Books'=>'Bøger','Contact us'=>'Kontakt os','Three buttons'=>'Tre knapper','Block pattern descriptionA heading preceded by a chapter number, and followed by a paragraph.'=>'En overskrift med et kapitelnummer foran, og efterfulgt af et afsnit. ','These preliminaries settled, he did not care to put off any longer the execution of his design, urged on to it by the thought of all the world was losing by his delay, seeing what wrongs he intended to right, grievances to redress, injustices to repair, abuses to remove, and duties to discharge.'=>'Da han havde gjort alle disse forberedelser, ønskede han ikke at vente længere med at føre sit forsæt ud i livet, for det pinte ham, at verden efter hans mening måtte lide afsavn, hvis han lod vente på sig, i betragtning af de krænkelser han agtede at hævne, den uret han ville rette op på, de urimeligheder han ville afbøde, de overgreb han ville råde bod på, og den gæld der skulle indløses.','Which treats of the first sally the ingenious Don Quixote made from home'=>'Der handler om første gang, den sindrige don Quixote drog ud fra sin hjemegn.','Heading and paragraph'=>'Overskrift og afsnit','Block pattern descriptionTwo columns of text, each with an image on top.'=>'To kolonner med tekst, hver med et billede øverst.','But of all there were none he liked so well as those of the famous Feliciano de Silva\'s composition, for their lucidity of style and complicated conceits were as pearls in his sight, particularly when in his reading he came upon courtships and cartels, where he often found passages like "the reason of the unreason with which my reason is afflicted so weakens my reason that with reason I murmur at your beauty;" or again, "the high heavens render you deserving of the desert your greatness deserves."'=>'Og af dem alle syntes han bedst om bøgerne af den navnkundige Feliciano de Silva, for han fandt, at dennes klare prosa og dunkle tankegange var som perler; og endnu mere begejstret blev han, når han nåede frem til at læse kærlighedsbrevene og udfordringsskrivelserne, hvor der ofte stod skrevet: “Den ufornuftens fornuft, der udøves mod min fornuft, svækker i den grad min fornuft, at det er ganske fornuftigt, at jeg beklager mig over jeres skønhed.” Og ligeledes, når han læste: “De høje himle, der guddommeligt befæster jeres guddommelighed med stjerner og lader jer fortjene den fortjenstfuldhed, som jeres storhed fortjener.”','They must know, then, that the above-named gentleman whenever he was at leisure (which was mostly all the year round) gave himself up to reading books of chivalry with such ardour and avidity that he almost entirely neglected the pursuit of his field-sports, and even the management of his property; and to such a pitch did his eagerness and infatuation go that he sold many an acre of tillageland to buy books of chivalry to read, and brought home as many of them as he could get.'=>'Man skal altså vide, at denne adelsmand i sine ledige stunder, og ledig var han størstedelen af året, henfaldt til at læse ridderbøger med så stor en lyst og begejstring, at han næsten fuldstændig glemte at gå på jagt og endda også forsømte forvaltningen af sit gods; han var så optaget og forblændet af bøgerne, at han solgte mange tønder dyrket mark for at købe ridderbøger, og således anskaffede han sig alle dem, han kunne få fat i.','Two columns of text with images'=>'To kolonner tekst med billeder','Block pattern descriptionTwo columns of text preceded by a long heading.'=>'To kolonner af tekst efter en lang titel.','The rest of it went in a doublet of fine cloth and velvet breeches and shoes to match for holidays, while on week-days he made a brave figure in his best homespun. He had in his house a housekeeper past forty, a niece under twenty, and a lad for the field and market-place, who used to saddle the hack as well as handle the bill-hook. The age of this gentleman of ours was bordering on fifty; he was of a hardy habit, spare, gaunt-featured, a very early riser and a great sportsman.'=>'Resten gik til en skødedragt af sort klæde, knæbukser af fløjl til helligdagene med tøfler i samme stof, og til hverdag pyntede han sig i en dragt af det fineste, ufarvede gråbrune klæde. I hans hus var der en husholderske, der havde rundet de fyrre, og en niece, der endnu ikke var fyldt tyve år, og endelig en tjener, der tog sig af markarbejdet og ledsagede ridderen, sadlede krikken op og var flink til at bruge beskærersaksen. Vores adelsmand nærmede sig de halvtreds år. Han var senet og mager, med skarptskåret ansigt, morgenduelig og glad for at gå på jagt.','In a village of La Mancha, the name of which I have no desire to call to mind, there lived not long since one of those gentlemen that keep a lance in the lance-rack, an old buckler, a lean hack, and a greyhound for coursing. An olla of rather more beef than mutton, a salad on most nights, scraps on Saturdays, lentils on Fridays, and a pigeon or so extra on Sundays, made away with three-quarters of his income.'=>'I en lille by i La Mancha, hvis navn jeg ikke lige kan huske, levede der for nylig en adelsmand af den slags, der har en lanse stående i sit våbenstativ, et gammelt skindskjold, en affældig krikke og en omstrejfende mynde. I gryden boblede der mere oksekød end vædderkød, hachis de fleste aftener, fastemad om lørdagen, linser om fredagen og dueunger som lidt ekstra om søndagen, alt dette slugte tre fjerdedele af hans udkomme.','Which treats of the character and pursuits of the famous gentleman Don Quixote of La Mancha'=>'Der handler om den navnkundige og tapre adelsmand don Quixote de la Mancha, hans stand og virke','Two columns of text'=>'To kolonner tekst','Block pattern descriptionA large hero section with an example background image and a heading in the center.'=>'En stor top-sektion med eksempel på billedbaggrund og en centreret overskrift.','Don Quixote'=>'Don Quijote','Large header with a heading'=>'Stor sidetop med overskrift','Block pattern descriptionTwo buttons, one filled and one outlined, side by side.'=>'To knapper, en fyldt og en med omrids, ved siden af hinanden.','About Cervantes'=>'Om Cervantes','Download now'=>'Hent nu','Two buttons'=>'To knapper','An old pencil drawing of Don Quixote and Sancho Panza sitting on their horses, by Wilhelm Marstrand.'=>'En gammel blyantstegning af Don Quijote og Sancho Panza på deres heste, tegnet af Wilhelm Marstrand.','Block pattern descriptionAn image gallery with two example images.'=>'Et billedgalleri med to billedeksempler.','Two images side by side'=>'To billeder side om side','Block pattern descriptionA large hero section with a bright gradient background, a big heading and a filled button.'=>'En stor top-sektion med en lys gradueret baggrund, en stor overskrift og udfyldt knap.','Read now'=>'Læs nu','Thou hast seen<br>nothing yet'=>'Du har set<br>intet endnu','Write title…'=>'Skriv titel...','Large header with a heading and a button '